s.x:
var $bm_rt;
var a;
$bm_rt = a = $bm_sum(thisLayer.effect('Fish Rotation')('Angle'), 90);
if ($bm_mod(a, 360) > 180) {
    $bm_rt = [
        -value[0],
        value[1]
    ];
} else {
    $bm_rt = value;
}

ks.x:
var $bm_rt;
var a, a;
a = $bm_sum(thisLayer.effect('Fish Rotation')('Angle'), 90);
a = $bm_sub(1, Math.abs(Math.sin(degreesToRadians(a))));
$bm_rt = valueAtTime(a);

s.x:
var $bm_rt;
var a, a;
a = thisLayer.effect('Fish Rotation')('Angle');
a = $bm_mul(Math.abs(Math.sin(degreesToRadians(a))), 100);
$bm_rt = [
    a,
    100
];

